import React, {useState} from 'react';
import { Tabs, Button, Modal} from 'antd';
import { HomeOutlined, DashboardOutlined, FormOutlined, UserOutlined } from '@ant-design/icons';
import TiposDeSiniestro from './TiposDeSiniestros';
import { useNavigate } from 'react-router-dom';
import ContenidoPrincipalAjustador from './ContenidoPrincipalAjustador';
import InactivityMonitor from '../Resources/InactivityMonitor';

const { TabPane } = Tabs;

const PrincipalAjustador = () => {

    const navigate = useNavigate();

//funcion para el boton de cierre de sesion
    const handleLogout = () => {
      localStorage.removeItem('token');
      navigate('/Login');
    };


    const [showInactivityAlert, setShowInactivityAlert] = useState(false);
    let inactivityTimer;
    const handleInactive = () => {
        setShowInactivityAlert(true);
    };

    const handleYes = () => {
        setShowInactivityAlert(false);
        clearTimeout(inactivityTimer); // Limpiar el temporizador existente

        // Realizar cualquier acción adicional cuando el usuario elige "Sí"
    };

    const handleNo = () => {
        setShowInactivityAlert(false);
          localStorage.removeItem('token');
          navigate('/Login');
                // Realizar cualquier acción adicional cuando el usuario elige "No"
    };

  return (
    <div className="app-container">
       <InactivityMonitor onInactive={handleInactive} >
      <div className="content">
        <Tabs
          defaultActiveKey="1"
          tabPosition="bottom"
          size="large"
          animated
          className="custom-tabs"
        >
          <TabPane
            tab={
              <span>
                <HomeOutlined />
              </span>
            }
            key="1"
          >
            <ContenidoPrincipalAjustador/>
            {/* <Button type="primary" onClick={handleLogout}>
              Cerrar Sesión
            </Button> */}
          </TabPane>
          <TabPane
            tab={
              <span>
                <FormOutlined />
              </span>
            }
            key="2"
          >
            <h2>Registro de siniestros</h2>
            <TiposDeSiniestro/>
            <br></br>
            <br></br>
            <br></br>
            <br></br>

          </TabPane>
          <TabPane
            tab={
              <span>
                <DashboardOutlined />
              </span>
            }
            key="3"
          >
            <h2>Contenido de Likes</h2>
          </TabPane>
          <TabPane
            tab={
              <span>
                <UserOutlined />
              </span>
            }
            key="5"
          >
            <h2>Contenido de Profile</h2>
          </TabPane>
        </Tabs>
      </div>
      </InactivityMonitor>
      <Modal
        visible={showInactivityAlert}
        title="¿Sigues aquí?"
        footer={[
          <Button key="yes" onClick={handleYes}>Sí</Button>,
            <Button key="no" onClick={handleNo}>No</Button>,
          ]}
              onCancel={handleNo}
            >
              Tu sesión está a punto de expirar en 1 minuto debido a la inactividad. ¿Deseas continuar?
      </Modal>
    </div>
  );
};

export default PrincipalAjustador;
